import React from 'react';

const Character = (props) => {
  return (
    <div id={props.key}>
      <img src={props.image} alt={props.name}/>
      <h2>{props.name}</h2>
      <img alt={props.characterObject.species} 
                src={props.characterObject.species === 'Human' ? human : alien }></img>
    </div>
  )
}

export default Character;
